INSERT INTO `cc_pingce` (`log_id`, `user_id`, `title`, `neirong`, `create_at`, `create_by`, `delete_is`) VALUES
	(1, 1, '行政能力评测', '张三在组织管理方面表现出色，能够有效地协调团队成员，优化工作流程，具有出色的行政能力和组织协调能力。111', '2024-04-21 10:26:17', '1', NULL),
	(2, 2, '业务技能评测', '李四在业务开发和客户关系管理方面表现突出，他的业务推广能力和客户维护技巧都得到了上级和客户的一致好评。', '2024-04-21 10:27:17', '1', NULL),
	(3, 3, '沟通能力评测', '王五在团队内外的沟通方面非常出色，无论是与同事合作还是与客户沟通，都能够清晰、有效地表达自己的观点和建议。', '2024-04-21 10:28:17', '1', NULL),
	(4, 4, '创新思维评测', '赵六具有创新思维，经常能够提出新颖的想法和解决方案，对于解决问题和推动项目进展起到了积极的作用。', '2024-04-21 10:29:17', '1', NULL),
	(5, 5, '团队合作评测', '孙七在团队合作中展现出良好的团队协作精神，他能够有效地与团队成员合作，解决问题，确保项目按计划顺利进行。', '2024-04-21 10:30:17', '1', NULL),
	(6, 6, '时间管理评测', '周八在时间管理方面做得非常好，能够合理规划工作时间，高效地完成任务，确保工作质量和进度达到预期。22', '2024-04-21 10:31:17', '1', NULL),
	(7, 7, '客户服务评测', '吴九在客户服务方面表现优秀，他总是能够满足客户的需求，提供高质量的服务，赢得了客户的高度认可和信赖。', '2024-04-21 10:32:17', '1', NULL),
	(8, 8, '决策能力评测', '郑十在决策方面具有很高的能力，他能够在复杂的情况下做出明智的决策，帮助团队避免风险，实现项目目标。', '2024-04-21 10:33:17', '1', NULL),
	(9, 9, '分析能力评测', '钱十一具有出色的数据分析能力，他能够准确地分析数据，提炼有价值的信息，为公司的决策提供有力的支持。11', '2024-04-21 10:34:17', '1', NULL),
	(10, 10, '领导力评测', '孔十二展现出卓越的领导力，能够有效地激励团队成员，引导团队向目标前进，实现了多个关键项目的成功。', '2024-04-21 10:35:17', '1', NULL),
